import React from 'react';
import './App.css';
import { NavLink, Switch, Route } from 'react-router-dom';
import Home from './Home';
import About from './About';
import NewsSources from './NewsSources';
import Compare from './Compare';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => (
  <div className='app'>
    <Navigation />
    <Main />
  </div>
);

const Navigation = () => (
  <nav class="navbar navbar-dark bg-dark">
    <a class="navbar-brand" href="/">Navbar</a>

      <ul class="navbar-nav mr-auto">
        <li class="nav-item">
          <NavLink exact activeClassName="current" to='/'>Home</NavLink>
        </li>
        <li class="nav-item">
          <NavLink exact activeClassName="current" to='/about'>About</NavLink>
        </li>
        <li class="nav-item">
          <NavLink exact activeClassName="current" to='/news'>News Sources</NavLink>
        </li>
        <li class="nav-item">
          <NavLink exact activeClassName="current" to='/compare'>Compare</NavLink>
        </li>
      </ul>

  </nav>
);

const Main = () => (
  <Switch>
    <Route exact path='/' component={Home}></Route>
    <Route exact path='/about' component={About}></Route>
    <Route exact path='/news' component={NewsSources}></Route>
    <Route exact path='/compare' component={Compare}></Route>
  </Switch>
);

export default App;
